import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Sparkles } from 'lucide-react';
import Snowflake from '../components/common/Snowflake';
import ChristmasLights from '../components/common/ChristmasLights';
import { evaluatorLogin } from '../services/authService';

const HomePage = () => {
  const navigate = useNavigate();
  const [showEvaluatorLogin, setShowEvaluatorLogin] = useState(false);
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [error, setError] = useState('');
  const [loading, setLoading] = useState(false);

  const handleEvaluatorLogin = async () => {
    if (!username || !password) {
      setError('Please enter username and password');
      return;
    }

    setLoading(true);
    setError('');

    try {
      await evaluatorLogin(username, password);
      navigate('/evaluator');
    } catch (err) {
      setError(err.response?.data?.error || 'Login failed');
    } finally {
      setLoading(false);
    }
  };

  if (showEvaluatorLogin) {
    return (
      <div className="min-h-screen bg-gradient-to-br from-red-900 via-green-900 to-red-900 relative overflow-hidden">
        <ChristmasLights />
        {[...Array(30)].map((_, i) => (
          <Snowflake
            key={i}
            delay={i * 0.3}
            duration={10 + Math.random() * 10}
            left={Math.random() * 100}
          />
        ))}

        <div className="relative z-10 min-h-screen flex items-center justify-center p-4">
          <div className="bg-white/95 backdrop-blur rounded-2xl shadow-2xl p-8 max-w-md w-full">
            <h2 className="text-3xl font-bold text-red-700 text-center mb-6">
              üéÑ Evaluator Login üéÑ
            </h2>

            {error && (
              <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded mb-4">
                {error}
              </div>
            )}

            <div className="space-y-4">
              <div>
                <label className="block text-gray-700 font-semibold mb-2">Username</label>
                <input
                  type="text"
                  value={username}
                  onChange={(e) => setUsername(e.target.value)}
                  className="w-full p-3 border-2 border-gray-300 rounded-lg focus:border-red-600 focus:outline-none"
                  placeholder="Enter your username"
                />
              </div>

              <div>
                <label className="block text-gray-700 font-semibold mb-2">Password</label>
                <input
                  type="password"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  className="w-full p-3 border-2 border-gray-300 rounded-lg focus:border-red-600 focus:outline-none"
                  placeholder="Enter your password"
                />
              </div>

              <button
                onClick={handleEvaluatorLogin}
                disabled={loading}
                className="w-full bg-red-600 hover:bg-red-700 text-white py-3 rounded-lg text-lg font-bold shadow-lg transform hover:scale-105 transition-all disabled:opacity-50"
              >
                {loading ? 'Logging in...' : 'Login'}
              </button>

              <button
                onClick={() => setShowEvaluatorLogin(false)}
                className="w-full bg-gray-500 hover:bg-gray-600 text-white py-2 rounded-lg font-semibold"
              >
                Back
              </button>
            </div>

           
          </div>
        </div>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gradient-to-br from-red-900 via-green-900 to-red-900 relative overflow-hidden">
      <ChristmasLights />
      {[...Array(30)].map((_, i) => (
        <Snowflake
          key={i}
          delay={i * 0.3}
          duration={10 + Math.random() * 10}
          left={Math.random() * 100}
        />
      ))}

      <div className="relative z-10 min-h-screen flex items-center justify-center p-4">
        <div className="text-center">

          <div className="mb-8 animate-bounce">
            <Sparkles className="w-20 h-20 mx-auto text-yellow-300" />
          </div>

          <h1 className="text-5xl md:text-7xl font-bold text-white mb-4 animate-pulse">
            üéÑ Crib Competition üéÑ
          </h1>

          <h2 className="text-2xl md:text-3xl text-green-300 mb-8 font-semibold">
            Evaluation System 2025
          </h2>

          <div className="space-y-4">
            <button
              onClick={() => setShowEvaluatorLogin(true)}
              className="bg-red-600 hover:bg-red-700 text-white px-8 py-4 rounded-full text-xl font-bold shadow-lg transform hover:scale-105 transition-all duration-300 w-64 mx-auto block"
            >
              Evaluator Login ‚≠ê
            </button>

            <button
              onClick={() => navigate('/admin-login')}
              className="bg-green-600 hover:bg-green-700 text-white px-8 py-4 rounded-full text-xl font-bold shadow-lg transform hover:scale-105 transition-all duration-300 w-64 mx-auto block"
            >
              Admin Login üèÜ
            </button>
          </div>
        </div>
      </div>
    </div>
    
  );
};

export default HomePage;
